import image from '../assets/banner.png';
import PointsIcon from '../Icons/pointsIcon';

function header() {
  return (
    <div>
        <div style={{height: '50px', widht: 'full', backgroundColor: 'white', display: 'flex', flexDirection: 'row', justifyContent: 'space-between', alightItems: 'center'}}>
            <div style={{display: 'flex', flexDirection: 'column', marginLeft: '35px'}}>
                <PointsIcon fill={'#000'} widht={25} height={25} style={{marginTop: '5px'}}/>
                <PointsIcon fill={'#000'} widht={25} height={25}/>
                <PointsIcon fill={'#000'} widht={25} height={25}/>
            </div>
            <ul style={{ display: 'flex', flexDirection: 'row', listStyleType: 'none', padding: 0, justifyContent: 'end' }}>
                <li style={{marginRight: '35px'}}>Inicio</li>
                <li style={{marginRight: '35px'}}>Sobre mí</li>
                <li style={{marginRight: '35px'}}>Portafolio</li>
                <li style={{marginRight: '35px'}}>Contacto</li>
            </ul>
        </div>
        <img src={image} alt="Descripción de la imagen" />
    </div>
  );
}

export default header;
